import React from 'react';

function AboutSection() {
    const images = [
        { src: '/gradient-yellow.webp', alt: 'Curiosity', icon: 'brain-circuit' },
        { src: '/gradient-blue.webp', alt: 'Innovation', icon: 'lightbulb' },
        { src: '/gradient-green.webp', alt: 'Mentorship', icon: 'mentor' },
        { src: '/gradient-blue-yellow.webp', alt: 'Inclusion', icon: 'heart-handshake' }
    ];

    return (
        <div className="mx-auto max-w-2xl gap-x-14 lg:mx-0 lg:flex lg:max-w-none lg:items-center">
            <div className="w-full max-w-xl px-6 md:max-w-2xl lg:max-w-lg lg:shrink-0 lg:px-0 xl:max-w-3xl">
                <h1 className="text-4xl font-bold tracking-tight sm:text-6xl">
                    <span>About</span><br />
                    <span className="text-[oklch(44.889%_0.15545_-73.341)]">Concordia </span>
                    <span>AI Club</span>
                </h1>
                <p className="relative mt-6 text-lg leading-8 text-gray-600 lg:max-w-xl xl:max-w-none">
                    The Concordia AI Club is the premier AI club at Concordia University. We are dedicated to fostering an inclusive and vibrant community for students interested in artificial intelligence. We aim to provide all students from established AI researchers to folks wanting to get into the field with the knowledge and opportunity to engage with AI research & development. Our vision is to serve as a centralized hub for the AI community on campus, connecting everyone from domain experts and practitioners to theorists.
                    <br /><br />
                    We offer a wide range of activities such as student-led research projects, reading groups, workshops, and classes designed to equip members with essential AI skills.
                    <br /><br />
                    We also engage with non-profit organizations with the shared vision of democratizing AI and reducing global inequalities. By hosting small-group discussions and lectures with leading experts, the club provides invaluable networking and learning opportunities for students passionate about AI.
                </p>
            </div>
            <div className="mt-14 flex justify-center gap-4 px-2 sm:-ml-16 sm:gap-8 sm:pl-20 lg:-ml-0 lg:mt-0 lg:justify-end lg:pl-0">
                <div className="2xl w-40 flex-none space-y-6 sm:mr-0 sm:w-44 sm:space-y-8 sm:pt-52 lg:pt-36">
                    {images.slice(0, 2).map((image, index) => (
                        <div key={index} className="relative flex items-center justify-center overflow-hidden rounded-xl">
                            <img
                                alt={image.alt}
                                src={image.src}
                                className="aspect-[2/3] w-full rounded-xl object-cover shadow-lg"
                                width="1000"
                                height="1000"
                            />
                            <div className="absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 transform rounded-full bg-white p-4">
                                <IconComponent icon={image.icon} />
                            </div>
                            <div className="absolute inset-0 flex items-end justify-center rounded-xl bg-black/10 p-4 transition-opacity lg:opacity-0">
                                <div className="bg-gradient-to-b from-neutral-50 to-neutral-200 bg-clip-text text-lg font-bold text-transparent md:text-2xl">
                                    {image.alt}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
                <div className="w-40 flex-none space-y-6 pt-32 sm:w-44 sm:space-y-8 sm:pt-0">
                    {images.slice(2).map((image, index) => (
                        <div key={index} className="relative flex items-center justify-center overflow-hidden rounded-xl">
                            <img
                                alt={image.alt}
                                src={image.src}
                                className="aspect-[2/3] w-full rounded-xl object-cover shadow-lg"
                                width="1000"
                                height="1000"
                            />
                            <div className="absolute left-1/2 top-1/2 -translate-x-1/2 -translate-y-1/2 transform rounded-full bg-white p-4">
                                <IconComponent icon={image.icon} />
                            </div>
                            <div className="absolute inset-0 flex items-end justify-center rounded-xl bg-black/10 p-4 transition-opacity lg:opacity-0">
                                <div className="bg-gradient-to-b from-neutral-50 to-neutral-200 bg-clip-text text-lg font-bold text-transparent md:text-2xl">
                                    {image.alt}
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
}

// Helper component for icons
function IconComponent({ icon }) {
    switch (icon) {
        case 'brain-circuit':
            return (
                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="size-8 text-[oklch(44.889%_0.15545_-73.341)]">
                    <path d="M12 5a3 3 0 1 0-5.997.125 4 4 0 0 0-2.526 5.77 4 4 0 0 0 .556 6.588A4 4 0 1 0 12 18Z"></path>
                    <path d="M9 13a4.5 4.5 0 0 0 3-4"></path>
                    <path d="M6.003 5.125A3 3 0 0 0 6.401 6.5"></path>
                    <path d="M3.477 10.896a4 4 0 0 1 .585-.396"></path>
                    <path d="M6 18a4 4 0 0 1-1.967-.516"></path>
                    <path d="M12 13h4"></path>
                    <path d="M12 18h6a2 2 0 0 1 2 2v1"></path>
                    <path d="M12 8h8"></path>
                    <path d="M16 8V5a2 2 0 0 1 2-2"></path>
                </svg>
            );
        // Add other icon cases here...
        default:
            return null;
    }
}

export default AboutSection;
